import React from 'react'

const handleLike = () => {
  addLikes({
    user: blog.user,
    title: blog.title,
    author: blog.author,
    url: blog.url,
    likes: blog.likes + 1
  },
  blog.id);
};

const Blog = ({blog}) => (
  <div>
    {blog.title} {blog.author} {blog.url} {blog.likes} 
  </div>  
)

export default Blog
